// import { ViewComponent } from './view.component';
// import { MyRequestsComponent } from './my-requests.component';
// import { AssignedToMeComponent } from './assigned-to-me.component';

const routes = [
    {
        path: '', component: LayoutComponent,
        children: [
            // Commented routes will be uncommented as components are created
            // { path: '', component: ListComponent },
            // { path: 'my-requests', component: MyRequestsComponent },
            // { path: 'assigned-to-me', component: AssignedToMeComponent },
            // { path: 'add', component: AddEditComponent },
            // { path: 'edit/:id', component: AddEditComponent },
            // { path: 'view/:id', component: ViewComponent }
        ]
    }
];

@NgModule({
    imports: [
        CommonModule,
        ReactiveFormsModule,
        RouterModule.forChild(routes)
    ],
    declarations: [
        LayoutComponent,
        // Commented declarations will be uncommented as components are created
        // ListComponent,
        // AddEditComponent,
        // ViewComponent,
        // MyRequestsComponent,
        // AssignedToMeComponent
    ]
})
